import { NavLink } from "react-router-dom"


function MainNavigation() {
  return (
    <div>
       <NavLink to="/">
  {({ isActive }) => (
    <button className={isActive ? "active" : undefined}>Home</button>
  )}
</NavLink>
<NavLink to="/events">
  {({ isActive }) => (
    <button className={isActive ? "active" : undefined}>Events Page</button>
  )}
</NavLink>
<NavLink to="/events/new">
  {({ isActive }) => (
    <button className={isActive ? "active" : undefined}>New Event</button>
  )}
</NavLink>

    </div>
  )
}

export default MainNavigation
